import './ExpenseItem.css';

function Bid(props) {
    return (
        <div>
            <table>
            <tr>
                <th>Bid Amount</th>
                <th>Name</th>
                <th>Email</th>
                <th>Mobile</th>
            </tr>
            <tr>
                <td>${props.amount}</td>
                <td>{props.firstName}</td>
                <td>{props.email}</td>
                <td>{props.phone}</td>
            </tr>
            </table>
        </div>
    );
}

export default Bid;
